import React from 'react';
import Button1 from './Button';

// Компоненты
class Header extends React.Component{
	render () {
		return(
			<header className='header'>
				{this.props.title}
				<Button/>
				<Button text="Button"/>
			</header>
		)
	}
};

export default Header;
